(ns advent-of-code-2018.dec-fifth)

(def test-input
  (map str "dabAcCaCBAcCcaDA"))

(def real-input
  "")

(defn split-into-chunks
  [test-input]
  (->> test-input
       (map str)
       (partition-by clojure.string/upper-case)))

(defn react
  [letters]
  (loop [f [] letters letters]
    (if (< (count letters) 2)
      (concat f letters)
      (if-let [head (when (= (first letters) (second letters))
                      (take 2 letters))]
        (recur (cons f (first letters)) (rest letters))
        (recur f (drop 2 letters))))))


(defn part1
  [input]
  (loop [unreacted input]
    (let [chunks (split-into-chunks unreacted)
          reacted (apply str (flatten (map react chunks)))]
      (if (= (count reacted) (count unreacted))
        (count reacted)
        (recur reacted)))))


(defn part2
  [input]
  "Wait like 2 minutes"
  (reduce (fn [x unit]
            (let [y (->> input
                         seq
                         (map str)
                         (remove #(#{unit (clojure.string/upper-case unit)} %))
                         (apply str)
                         part1)]
              (min x y))) 1000000 ["a" "b" "c" "d" "e" "f" "g" "h" "i" "j" "k" "l" "m" "n" "o" "p" "q" "r" "s" "t" "u" "v" "w" "x" "y" "z"]))
